import React from 'react';
import { Link } from 'react-router-dom'

import Helmet from '../components/Helmet'
import HeroSlider from '../components/HeroSlider';
import Section, { SectionTitle, SectionBody} from '../components/Section';
import PoliciyCard from '../components/PoliciyCard';
import Grid from '../components/Grid'
import ProductCard from '../components/ProductCard';

import heroSliderData from '../assets/fake-data/hero-slider';
import policy from '../assets/fake-data/policy';
import productData from '../assets/fake-data/products';

const Home = () => {
  return (
    <Helmet title="Home page">
      {/* hero slider */}
      <HeroSlider
          data={heroSliderData}
          control={true}
          auto={false}
          timeOut={5000}
      />
      {/* end hero slider */}

      {/* policy section */}
      <Section>
        <SectionBody>
          <Grid
            col={4}
            mdcol={2}
            smcol={1}
            gap={20}
          >
            {
                policy.map((item, index) => <Link key={index} to="/policy">
                <PoliciyCard
                name={item.name}
                description={item.description}
                icon={item.icon}
             />
                </Link>)
          }
          </Grid>
        </SectionBody>
      </Section>
      {/* end policy section */}

      {/* best selling section */}
          <Section>
            <SectionTitle>
              Top selling products of the week
            </SectionTitle>
            <SectionBody>
            <Grid
               col={4}
               mdcol={2}
               smcol={1}
               gap={20}
            >
              {
                productData.getProducts(4).map((item, index) => (
                <ProductCard
                 key={index}
                 img01={item.image01}
                 img02={item.image02}
                 name={item.title}
                 price={Number(item.price)}
                 slug={item.slug}
                  />
                    ))
                }
              </Grid>
            </SectionBody>
          </Section>
      {/* end best selling section */}

      {/* new arrival section */}
      <Section>
            <SectionTitle>
               new product
            </SectionTitle>
            <SectionBody>
            <Grid
               col={4}
               mdcol={2}
               smcol={1}
               gap={20}
            >
              {
                productData.getProducts(4).map((item, index) => (
                <ProductCard
                 key={index}
                 img01={item.image01}
                 img02={item.image02}
                 name={item.title}
                 price={Number(item.price)}
                 slug={item.slug}
                  />
                    ))
                }
              </Grid>
            </SectionBody>
          </Section>
      {/* end arrival section */}
    </Helmet>
  )
};

export default Home;
